    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( + 43 + + col0 * 14 ) NOT BETWEEN col1 AND + 47 / + col1 + - 41 * col0;
  - name: tab2

outputs:
  - name: q11863.out
    data: |
      46	51	23
      64	77	40
      75	67	58
